import React from "react";

class ShopPage extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      itemCollection: SHOP_ITEMS,
    };
  }

  render() {
    return <div>{this.state.itemCollection}</div>;
  }
}
export default ShopPage;
